.container{
  width: 100%;
  height: 100%;
  display:flex;

}
.left_ul{
  height: 100%;
  margin: 0;
  padding:0;
  overflow: auto;
}
.left_ul::-webkit-scrollbar {
  width: 0px;
}
.left_ul li{
  cursor: pointer;
  position: relative;
  height: auto;
  line-height: 50px;
  font-size: 14px;
  min-width: 220px;
}
.left_ul li >div{
  padding-left: 20px;
  padding-right: 10px;
}

.left_ul li >div:first-child:hover{
  background-color: rgb(255, 240, 193);
}
.left_ul li img{
  vertical-align:middle;
  display: inline-block;
  padding-right: 5px;
}
.indexbgc{
  position: absolute;
  width: 5px;
  height: 50px;
  left: 0;
  top: 0px;
  z-index: 2;
}
.isopen{
  max-width:20px;
  float:right;
  margin-top:25px;
}
.isclose{
  max-width:20px;
  float:right;
  margin-top:25px;
  transform:rotate(90deg);
}
.layers{
  opacity: 0.5;
  color: #000;
}
